sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.response_status == '200'){
  	try{

      var responseObj = JSON.parse(inputs.response_body);    
      var classList = responseObj.constants_list[0].adventureclass_list;
      var classesArray = [];
       var j = 0;

	for (var i=0; i < classList.length; i++){
   //   gs.info("ID: " + raceList[i].id + " Name: " + raceList[i].name + " Display: " + raceList[i].displayname);
      var classObject = {};
      classObject.id = classList[i].id;
      classObject.name = classList[i].name;
      classObject.subclass = classList[i].issubclass;
      classesArray[j] = classObject;
      j++;      
    }
       outputs.classes = classesArray;


       }catch(err) {
      gs.info('Error in parsing classes results: ' + err);
    }

  } else{
    gs.info('GET EQ Constants Action:Get EQ2 Parse classes stage has failed: Status ' + inputs.reponse_status + ' Code: ' + inputs.response_error_code + ' Message: ' + inputs.response_error_message);
  }
})(inputs, outputs);

